window.bookSummaryJSON = "<p>Relationships only she remembers after regression? Changes continuing to snowball out of control? Sometimes knowing the former future is a double-edged sword.</p> <p>Armed with memories of her impending past, Ash bids farewell to Lotus Lake and sets her sights on conquering the crows of Clover City. However, her knowledge and newfound lease on life comes with a twist—each decision she makes sets off a chain reaction of consequences, revealing that there's far more to her future than even she expected.</p> <p>Navigating the world of Elysium guided by her vast experience and wits, Ash works to forge new friendships while evading the pitfalls that trapped her in unhealthy spirals. Armed with luck, clever tricks, and overpowered spells, she’s on a quest to live a better life.</p> <p>She’s ready to show everyone what a Mystic Mage is truly capable of, using everything she has to accumulate wealth, grow her power, and murder the murders.</p>"; 
